import Analysis from '../Analysis';
import Summary from '../Summary';
import {useLoaction} from 'react-router-dom'
const Result = () => {
    const {id, state} = useLoaction()
    return (
        <>{console.log(state)}
            <Summary />
            <Analysis />
        </>
    )
}

export default Result;
